  summary: "\nImplementation of <xref href=\"SuperOffice.CRM.IDocumentInfo\" data-throw-if-not-resolved=\"false\"></xref>; create through factory (see remarks)\n"
  remarks: "\nTo create an instance of DocumentInfoProvider, use \n<pre><code>var info = ClassFactory.Create&lt;IDocumentInfo>(doc);</code></pre>\nwhere doc is a <xref href=\"SuperOffice.CRM.Entities.Document\" data-throw-if-not-resolved=\"false\"></xref>, to use an\nalready-loaded entity object (that may also contain unsaved data);\nor where doc is an int that is a documentId, which will cause database fetches. \nThe factory methods at the bottom of this class will handle both cases.\n<p></p>\nIf you are in the Cpp world, or otherwise have unsaved data that you would\nwant to use without incurring the overhead of an entity object, instantiate\na <xref href=\"SuperOffice.CRM.Entities.Providers.SimpleDocumentInfo\" data-throw-if-not-resolved=\"false\"></xref> instead, fully populate it, and pass that to the factory.\n"
